import React from 'react';
import AppLayout from "../components/AppLayout";
import {useSelector} from "react-redux";


const Home = () =>{
    const {isLoggdIn} = useSelector((state)=>state.user);
    const {mainPosts} = useSelector((state)=>state.post);
    return(
        <AppLayout>
            <PostForm/>
            <PostCard/>
        </AppLayout>
    );
}

export default Home;
